import './homepage.css';

const HomePage = () => {

    return (
        <div>

            <div className="home-header">
                <header className="blog-header py-3">
                    <div
                        className="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
                        <i className="fa fa-book home-logo large"/>
                        <h5 className="my-0 mr-md-auto font-weight-normal">LibraryService</h5>
                        <nav className="my-2 my-md-0 mr-md-3">
                            <a className="p-2 text-dark">Log in</a>
                        </nav>
                    </div>
                </header>
            </div>


            <main className="container home-content">

                <h1 className="home-title">BookFund</h1>

                <div className="row home-tools">
                    <h5>Library</h5>

                    {/*<div className="dropdown home-dropdown">*/}
                    {/*    <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenu2"*/}
                    {/*            data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">*/}
                    {/*        Dropdown*/}
                    {/*    </button>*/}
                    {/*    <div className="dropdown-menu" aria-labelledby="dropdownMenu2">*/}
                    {/*        <button className="dropdown-item" type="button">Action</button>*/}
                    {/*        <button className="dropdown-item" type="button">Another action</button>*/}
                    {/*        <button className="dropdown-item" type="button">Something else here</button>*/}
                    {/*    </div>*/}
                    {/*</div>*/}

                    <select id="selectvalue">

                        <option>5</option>

                        <option>10</option>

                        <option>15</option>

                        <option>20</option>

                        <option>25</option>

                    </select>

                    <h5>Sort by</h5>
                    {/*<div className="dropdown home-dropdown">*/}
                    {/*    <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenu2"*/}
                    {/*            data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">*/}
                    {/*        Dropdown*/}
                    {/*    </button>*/}
                    {/*    <div className="dropdown-menu" aria-labelledby="dropdownMenu2">*/}
                    {/*        <button className="dropdown-item" type="button">Action</button>*/}
                    {/*        <button className="dropdown-item" type="button">Another action</button>*/}
                    {/*        <button className="dropdown-item" type="button">Something else here</button>*/}
                    {/*    </div>*/}
                    {/*</div>*/}

                    <select id="selectvalue">

                        <option>5</option>

                        <option>10</option>

                        <option>15</option>

                        <option>20</option>

                        <option>25</option>

                    </select>

                    <button type="button" className="btn btn-info mx-r search-button">Search options</button>

                </div>

                <table className="table">
                    <thead>
                    <tr>
                        <th>1 поле</th>
                        <th>2 поле</th>
                        <th>3 поле</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <td>1 поле</td>
                        <td>1 поле</td>
                        <td>1 поле</td>
                    </tr>
                    <tr>
                        <td>1 поле</td>
                        <td>1 поле</td>
                        <td>1 поле</td>
                    </tr>
                    <tr>
                        <td>1 поле</td>
                        <td>1 поле</td>
                        <td>1 поле</td>
                    </tr>
                    </tbody>
                </table>

            </main>

        </div>
    )

}

export default HomePage;
